import React from 'react';
import data from '../data';

import Chip from '@mui/material/Chip';
import Avatar from '@mui/material/Avatar';

export default function Landing() {
  const { newConnections } = data;

  return (
    <div className='newConnections'>
      <div className='newConnectionsHeading'>
        <p className='headingSemi'>New Connections</p>{' '}
        <Chip label='2' size='small' />
      </div>
      <div className='newConnectionsBar'>
        {newConnections.map((item) => {
          const { id, name, avatar } = item;
          return (
            <div className='newItem' key={id}>
              <Avatar
                src={avatar}
                size='large'
                sx={{ height: '55px', width: '55px' }}
              />
              <p className='headingFade'>{name}</p>
            </div>
          );
        })}
      </div>
    </div>
  );
}
